func:
let temp = msg.payload

if(temp < 20){

    msg.payload = {
    "command": "update_text",
    "selector": "#text",
    "textContent": "OFF"
};
}
else msg.payload = {
    "command": "update_text",
    "selector": "#text",
    "textContent": "ON"
};

return msg;

let brightness = msg.payload

if(brightness < 300){

msg.payload = {
    "command": "set_style",
    "selector": "#light",
    "attributeName": "fill",
    "attributeValue": "yellow"
};
}
else msg.payload = {
    "command": "set_style",
    "selector": "#light",
    "attributeName": "fill",
    "attributeValue": "black"
};

return msg;

let airquality = msg.payload

if(airquality < 100){

    msg.payload = {
    "command": "set_style",
    "selector": "#airp",
    "attributeName": "fill",
    "attributeValue": "white"
};
}
else msg.payload = {
    "command": "set_style",
    "selector": "#airp",
    "attributeName": "fill",
    "attributeValue": "green"
};

return msg;

var message = msg.payload;
global.set("global_bright", msg.payload);
msg.title = "brightness";
return msg;

var message = msg.payload;
global.set("global_temp", message);
msg.title = "temp";
return msg;

var message = msg.payload;
global.set("global_airq", msg.payload);
msg.title = "air_quality";
return msg;

var x = global.get("global_bright");
msg.payload = x;
msg.title = "brightness";
return msg;

var x = global.get("global_temp");
msg.payload = x;
msg.title = "temp";
return msg;

var x = global.get("global_airq");
msg.payload = x;
msg.title = "air_quality";
return msg;

var message = msg.payload;
global.set("global_light_controller", msg.payload);
msg.title = "light_controller";
return msg;

var message = msg.payload;
global.set("global_airc_controller", msg.payload);
msg.title = "airc_controller";
return msg;

var message = msg.payload;
global.set("global_airp_controller", msg.payload);
msg.title = "airp_controller";
return msg;

let dataC = [[]];
let dataLabels = [];

for (let X in msg.payload) 
{
    dataLabels[X] = msg.payload[X]._time;
    dataC[0][X] = msg.payload[X]._value;
}

var m={
    "series":["Air Quality", "Brightness", "Temperature"],
    "data":dataC,
    "labels":dataLabels
};

return {payload:[m]};

let temp = msg.payload[0].data[0][0];

var opts = {
  reply_markup: JSON.stringify({
    "inline_keyboard": [[
      {
        "text": "ON Air_Cond",
        "callback_data": "/on-AC"
      },
      {
        "text": "OFF Air_Cond",
        "callback_data": "/off-AC"
      }]
    ]
  })
};

msg.payload = temp;

if (temp > 30){

msg.payload = {
  chatId: "7189906546",
  type: "message",
  content: "[Temperature: "+msg.payload+" *C - high] Air-Conditioner will be automatically turn on! You can turn off/on using telegram."};
msg.payload.options = opts;
return msg;
}



return msg;

let airq = msg.payload[0].data[0][0];

var opts = {
  reply_markup: JSON.stringify({
    "inline_keyboard": [[
      {
        "text": "ON Air_Purifier",
        "callback_data": "/on-AP"
      },
      {
        "text": "OFF Air_Purifier",
        "callback_data": "/off-AP"
      }]
    ]
  })
};

msg.payload = airq;

if(airq > 100){

msg.payload = {
  chatId: "7189906546",
  type: "message",
  content: "[Air Quality: "+msg.payload+" AQI - high] Air-Purifier will be automatically turn on! You can turn off/on using telegram."};
msg.payload.options = opts;
return msg;
}



return msg;

let content = msg.payload.content;
msg.payload = content;
return msg;
